import React from "react";
import Banner from "../Components/common/Banner";
import HazirPaketler from "../Components/common/HazirPaketler";
import OwlCarouselVideo from "../Components/common/OwlCarouselVideo";

function HazirPaketlerPage() {
  return (
    <>
      <Banner />
      <HazirPaketler />
      <OwlCarouselVideo />
    </>
  );
}

export default HazirPaketlerPage;
